import PopularItemStyles from "./PopularItem.module.scss";


function PopularItem() {


  return (
    <div className={PopularItemStyles.planItemWrapper}>
        <div className={PopularItemStyles.popularImageWrapper}>
        <img alt="title" />
        </div>
        <span className={PopularItemStyles.popularCashbackWrapper}>cashback</span>
    </div>
  );
}

export default PopularItem;
